import React from "react";
import { Result, Button } from "antd";
import { SmileOutlined } from "@ant-design/icons";
const Index = (props) => {
  return (
    <div>
      <Result
        icon={<SmileOutlined />}
        title="Great, we have done all the operations!"
        extra={<Button type="primary">Next</Button>}
      />
    </div>
  );
};

export default Index;
